import React from "react";
import Header from "../Header";
// import Footer from "../Footer";
import NewPlayer from "../Players/NewPlayer";
import PlayersList from "../Players/PlayersList";

const App = ({ submitted }) => (
    <React.Fragment>
      <Header>dreamteam</Header>
      <NewPlayer />
      <PlayersList />
    </React.Fragment>
);

export default App;
